import React from "react";

import { Link } from "react-router-dom";
import { Buffer } from "buffer";

import Tabicon from '../../1_image_or_icon/food_script_tabicon.png'
import Arrow from '../../1_image_or_icon/Arrow_Button_UpAhead.png'

export const Registration_Field_Page = (props) => {

    const Field_Dispenser = (type,name,id,value,readonly,event) => {

        return <React.Fragment>

        <div
        style={{
            width: 'inherit',

            display:'flex',
            flexDirection:'column',
            justifyContent:'space-around',

            fontFamily: '큐트신민상',
            fontSize: '4vw',
            fontWeight: 'bold',

            letterSpacing: '1vw',
            margin: '1.5vh 0vw'

        }}
        >

            <label htmlFor={id}
            style={{

            }}
            >
            {name.slice(0,1).toUpperCase()}{name.slice(1)}/
            </label>
            
            <input 
            type={type}
            name={name}
            id={id}
            value={value}
            style={{
                width:'inherit',
                
                margin: '1vh 0vw 1vh 0vw',
                padding: '0.5vh 3vw',

                borderRadius: '7px',

            }}
            readOnly={readonly}
            onChange={event}
            ></input>

        </div>

        </React.Fragment>

    }

    return <React.Fragment>
            <div
            style={{
            width:'inherit',
            height:'inherit',
            
            display:'flex',
            flexDirection:'column',

            justifyContent:'center',
            alignItems: 'center'
            }}
            >


                <Link
                    to={'..'}
                    >
                    <img
                    src={Arrow}
                    style={{
                        width: '10vw',

                        position: 'absolute',
                        top: '3vh',
                        left: '6vw',

                        transform: 'rotate(270deg)'
                    }}
                    ></img>
                    </Link>

                <span
                style={{
                    fontFamily:'큐트신민상',
                    fontSize: '10vw',

                    position: 'relative',
                    
                    bottom: '3vh',

                    textAlign: 'center'
                }}
                >
                Account
                <br></br>    
                Registration</span>
                <span
                style={{
                    fontFamily:'큐트신민상',
                    fontSize: '7vw',

                    position: 'relative',
                    
                    bottom: '2.5vh',

                    textAlign: 'center'
                }}
                >( as {props.purpose} )</span>

                <form
                action="http://localhost:8080/registration"
                method='POST'
                >

                <div
                style={{
                    width: 'fit-content',
                    backgroundColor: 'white',
                    padding: '1vh 2vw 1vh 2vw',
                    borderRadius: '15px',
                    border: 'black solid 1.5px'
                }}
                >

                    <div
                    style={{
                        border: 'black dashed 3px',
                        padding: '3vh 8vw 6vh 8vw',
                        borderRadius: '10px'
                    }}
                    >
                        
                        {Field_Dispenser('text','name','name', null, false)}

                        {Field_Dispenser('email','email','email', null, false)}

                            <div
                            style={{
                                width: 'inherit',

                                display:'flex',
                                flexDirection:'column',
                                justifyContent:'space-around',

                                fontFamily: '큐트신민상',
                                fontSize: '4vw',
                                fontWeight: 'bold',

                                letterSpacing: '1vw',
                                margin: '1.5vh 0vw'
                            }}
                            >

                                
                                
                                <div
                                style={{
                                    border: 'black dotted 5px',
                                    textAlign: 'center',
                                    padding: '1vh 0vw',
                                    borderRadius: '5px'
                                }}
                                >

                                <label 
                                 htmlFor={`picture`}
                                 id='picture_label'
                                 >
                                    Picture
                                </label>
                                

                                </div>
                                
                                <input 
                                type='file'
                                name='picture'
                                id='picture'
                                style={{
                                    display: 'none',
                                    maxWidth:'40vw',
                                    
                                    margin: '1vh 0vw 1vh 0vw',
                                    padding: '0.5vh 3vw',

                                    borderRadius: '7px',
                                }}
                                onChange={
                                    (e)=>{
                                        const file = e.target.files[0];  
                                        console.log(e)
        
                                        if (file) {
                                        const reader = new FileReader();
        
                                        reader.readAsArrayBuffer(file);
        
                                        reader.onload = function(e) {
                                            const arrayBuffer = e.target.result;  
                                            e.target.value = arrayBuffer
                                            console.log(arrayBuffer);

                                            const rawdata = Buffer.from(e.target.result)
                                        
                                            const base64Image = rawdata.toString('base64')
                                            const imgsrc = `data:image/jpg;base64,${base64Image}`;
                                                
                                            // const picture_label= document.getElementById('picture_label')
                                            // picture_label.innerHTML = `
                                            //     <img
                                            //     src=${imgsrc}
                                            //     ></img>
                                            // `
                                        };
        
                                        reader.onerror = function(e) {
                                            console.error('Error reading file', e);
                                        }
                                    
                                        
                                        }}
                                    }
                                ></input>

                            </div>

                        {Field_Dispenser('text','password','password', null, false)}

                        {Field_Dispenser('text', 'position', 'position', `${props.purpose}`, true)}

                        <input
                        type="submit"
                        style={{
                            
                            width: '54vw',
                            // height: '3.5vh',

                            borderRadius: '10px',

                            padding: '1vh 0vw'
                        }}
                        value='Submit'
                        >
                        </input>

                    </div>

                </div>

                </form>

                <img
                src={Tabicon}
                style={{
                    width:'20vw',

                    position: 'relative',
                    top: '10vh'
                }}
                ></img>

            </div>

        </React.Fragment>
    

}

export default Registration_Field_Page
